import{_ as e,a as r,b as a,c as o,d as i,e as n,f as d}from"./chunks/radio-2.BVhjY8Cp.js";import{_ as s,c as l,a8 as h,o as c}from"./chunks/framework.BDnHobkS.js";const S=JSON.parse('{"title":"VOXL 2 Starling PX4 Development Drone","description":"","frontmatter":{},"headers":[],"relativePath":"zh/complete_vehicles_mc/modalai_starling.md","filePath":"zh/complete_vehicles_mc/modalai_starling.md"}'),p={name:"zh/complete_vehicles_mc/modalai_starling.md"};function m(u,t,g,b,f,v){return c(),l("div",null,t[0]||(t[0]=[h('<h1 id="voxl-2-starling-px4-development-drone" tabindex="-1">VOXL 2 Starling PX4 Development Drone <a class="header-anchor" href="#voxl-2-starling-px4-development-drone" aria-label="Permalink to &quot;VOXL 2 Starling PX4 Development Drone&quot;">​</a></h1><p>The <a href="https://modalai.com/starling" target="_blank" rel="noreferrer">Starling</a> is a SLAM development drone supercharged by <a href="./../flight_controller/modalai_voxl_2.html">VOXL 2</a> and PX4 with SWAP-optimized sensors and payloads optimized for indoor and outdoor autonomous navigation. Powered by Blue UAS Framework autopilot, VOXL 2, the Starling weighs only 275g and boasts an impressive 30 minutes of autonomous indoor flight time.</p><p><img src="'+e+'" alt="Overview"></p><p>The VOXL 2 Starling is a PX4 development drone that houses a <a href="./../flight_controller/modalai_voxl_2.html">VOXL 2</a> companion computer and PX4 flight controller, image sensors, GPS, and connectivity modem and is ready-to-fly out-of-the-box. The Starling features ModalAI’s <a href="https://docs.modalai.com/voxl-developer-bootcamp/" target="_blank" rel="noreferrer">open SDK</a> that has pre-configured autonomy models for computer vision assisted flight. This development drone is meant to help you get to market faster and accelerate your application development and prototyping.</p><p>This guide explains the minimal additional setup required to get the UAV ready to fly. It also covers a hardware overview, first flight, setting up WiFi, and more.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For complete and regularly updated documentation, please visit <a href="https://docs.modalai.com/starling-v2" target="_blank" rel="noreferrer">https://docs.modalai.com/starling-v2</a>.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you are new to VOXL, be sure to familiarize yourself with the core features of VOXL hardware and software by reviewing the <a href="https://docs.modalai.com/voxl-developer-bootcamp/" target="_blank" rel="noreferrer">VOXL Bootcamp</a>.</p></div><h2 id="购买渠道" tabindex="-1">购买渠道 <a class="header-anchor" href="#购买渠道" aria-label="Permalink to &quot;购买渠道&quot;">​</a></h2><p><a href="https://modalai.com/starling" target="_blank" rel="noreferrer">modalai.com/starling</a></p><h2 id="hardware-overview" tabindex="-1">Hardware Overview <a class="header-anchor" href="#hardware-overview" aria-label="Permalink to &quot;Hardware Overview&quot;">​</a></h2><p><img src="'+r+'" alt="Hardware Overview"></p><table tabindex="0"><thead><tr><th>Callout</th><th>描述</th><th>MPN</th></tr></thead><tbody><tr><td>A</td><td>VOXL 2</td><td>MDK-M0054-1</td></tr><tr><td>B</td><td>VOXL 4-in-1 ESC</td><td>MDK-M0117-1</td></tr><tr><td>C</td><td>Barometer Shield Cap</td><td>M10000533</td></tr><tr><td>D</td><td>ToF Image Sensor (PMD)</td><td>MDK-M0040</td></tr><tr><td>E</td><td>Tracking Image Sensor (OV7251)</td><td>M0014</td></tr><tr><td>F</td><td>Hires Image Sensor (IMX214)</td><td>M0025-2</td></tr><tr><td>G</td><td>AC600 WiFi Dongle</td><td>AWUS036EACS</td></tr><tr><td>H</td><td>GNSS GPS Module &amp; Compass</td><td>M10-5883</td></tr><tr><td>I</td><td>915MHz ELRS Receiver</td><td>BetaFPV Nano RX</td></tr><tr><td>J</td><td>USB C Connector on VOXL 2 (not shown)</td><td></td></tr><tr><td>K</td><td>VOXL Power Module</td><td>MCCA-M0041-5-B-T</td></tr><tr><td>L</td><td>4726FM Propellor</td><td>M10000302</td></tr><tr><td>M</td><td>Motor 1504</td><td></td></tr><tr><td>N</td><td>XT30 Power Connector</td><td></td></tr></tbody></table><h2 id="datasheet" tabindex="-1">Datasheet <a class="header-anchor" href="#datasheet" aria-label="Permalink to &quot;Datasheet&quot;">​</a></h2><h3 id="产品规格" tabindex="-1">产品规格 <a class="header-anchor" href="#产品规格" aria-label="Permalink to &quot;产品规格&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Component</th><th>技术规范</th></tr></thead><tbody><tr><td>飞控</td><td>VOXL2</td></tr><tr><td>Take-off Weight</td><td>275g (172g without battery)</td></tr><tr><td>Diagonal Size</td><td>211mm</td></tr><tr><td>Flight Time</td><td>&gt; 30 minutes</td></tr><tr><td>电机</td><td>1504</td></tr><tr><td>Propellers</td><td>120mm</td></tr><tr><td>框架</td><td>3mm Carbon Fiber</td></tr><tr><td>ESC</td><td>ModalAI VOXL 4-in-1 ESC V2</td></tr><tr><td>GPS</td><td>UBlox M10</td></tr><tr><td>RC Receiver</td><td>915mhz ELRS</td></tr><tr><td>Power Module</td><td>ModalAI Power Module v3 - 5V/6A</td></tr><tr><td>Battery</td><td>Sony VTC6 3000mah 2S, or any 2S 18650 battery with XT30 connector</td></tr><tr><td>高度</td><td>83mm</td></tr><tr><td>Width</td><td>187mm (Props folded)</td></tr><tr><td>Length</td><td>142mm (Props folded)</td></tr></tbody></table><h3 id="hardware-wiring-diagram" tabindex="-1">Hardware Wiring Diagram <a class="header-anchor" href="#hardware-wiring-diagram" aria-label="Permalink to &quot;Hardware Wiring Diagram&quot;">​</a></h3><p><img src="'+a+'" alt="Hardware Overview"></p><h2 id="tutorials" tabindex="-1">Tutorials <a class="header-anchor" href="#tutorials" aria-label="Permalink to &quot;Tutorials&quot;">​</a></h2><h3 id="elrs-set-up" tabindex="-1">ELRS Set Up <a class="header-anchor" href="#elrs-set-up" aria-label="Permalink to &quot;ELRS Set Up&quot;">​</a></h3><p>Binding your ELRS (ExpressLRS) receiver to a transmitter is a crucial step in preparing your VOXL 2 based PX4 Autonomy Developer Kit by ModalAI for flight. This process ensures a secure and responsive connection between your drone and its control system.</p><p>Follow this guide to bind your ELRS receiver to your transmitter.</p><h4 id="setting-up-the-receiver" tabindex="-1">Setting up the Receiver <a class="header-anchor" href="#setting-up-the-receiver" aria-label="Permalink to &quot;Setting up the Receiver&quot;">​</a></h4><ol><li><p><strong>Power On the Receiver</strong>: Once your drone is powered on, you&#39;ll notice the ELRS receiver&#39;s blue LED flashing. This is an indication that the receiver is on but has not yet established a connection with a transmitter.</p><p><img src="'+o+'" alt="Starling Receiver"></p></li><li><p><strong>Enter Binding Mode</strong>: To initiate binding, open a terminal and execute the <code>adb shell</code> and <code>voxl-elrs -bind</code> commands. You&#39;ll observe the receiver&#39;s LED switch to a flashing in a heartbeat pattern, signaling that it is now in binding mode.</p><p><img src="'+i+'" alt="Boot Screenshot"></p></li></ol><h4 id="setting-up-the-transmitter" tabindex="-1">Setting up the Transmitter <a class="header-anchor" href="#setting-up-the-transmitter" aria-label="Permalink to &quot;Setting up the Transmitter&quot;">​</a></h4><ol><li><p><strong>Access the Menu</strong>: On your Commando 8 radio transmitter included in the kit, press the left mode button to open the menu system.</p><p><img src="'+n+'" alt="Press Menu on RC"></p></li><li><p><strong>Navigate to ExpressLRS</strong>: Use the right button to select the first menu entry, which should be &quot;ExpressLRS.&quot;</p></li><li><p><strong>Find the Bind Option</strong>: With the &quot;ExpressLRS&quot; option selected, scroll down to the bottom of the menu to locate the &quot;Bind&quot; section. This can be done by pressing the right button downwards until you reach the &quot;Bind&quot; option.</p><p><img src="'+d+'" alt="Press Binding on RC"></p></li><li><p><strong>Initiate Binding</strong>: Select &quot;Bind&quot; to put the transmitter into binding mode. You will know the process has been successful when the transmitter emits a beep, indicating a successful bind.</p></li></ol><h4 id="completing-the-binding-process" tabindex="-1">Completing the Binding Process <a class="header-anchor" href="#completing-the-binding-process" aria-label="Permalink to &quot;Completing the Binding Process&quot;">​</a></h4><p>Once the transmitter is set to bind mode, the ELRS receiver on the drone will change its LED from flashing to a steady light, signifying a successful connection between the receiver and the transmitter.</p><ul><li><strong>Power Cycle</strong>: After the binding process is complete, it&#39;s essential to power cycle the VOXL 2 before attempting to fly. This means turning off the VOXL 2 and then turning it back on. This step ensures that all settings are properly applied and that the system recognizes the newly established connection.</li></ul><p>You should now have a successfully bound ELRS receiver to your transmitter, ready for use with the PX4 Autonomy Kit by ModalAI. A secure connection is vital for the reliable operation of your drone, so always confirm the binding status before flight.</p><h3 id="视频" tabindex="-1">视频 <a class="header-anchor" href="#视频" aria-label="Permalink to &quot;视频&quot;">​</a></h3><ul><li><a href="https://youtu.be/M9OiMpbEYOg" target="_blank" rel="noreferrer">VOXL 2 Starling Hardware Overview</a></li><li><a href="https://youtu.be/Cpbbye3Z6co" target="_blank" rel="noreferrer">VOXL 2 Starling First Flight Tutorial</a></li><li><a href="https://youtu.be/7OwGS-kcFVg" target="_blank" rel="noreferrer">VOXL 2 Starling ELRS Set Up</a></li></ul>',31)]))}const _=s(p,[["render",m]]);export{S as __pageData,_ as default};
